import React, { Component } from 'react';
import { connect } from 'react-redux';



class App extends Component {
  constructor(props) {
    super(props);
      this.state={
        ary:[]
      }
    }

  componentWillMount(){
    this.setState({
      ary: this.props.ary
    })
  }
  render() {
    return (
      <div>
        {JSON.stringify(this.props)}

      {JSON.stringify(this.state.ary)}

      {
        this.state.ary.map(res=>(
          <h1>{res.title}</h1>
        ))
      }
      </div>
    );
  }
}

const reciver = (state)=>{
  return{
    ary: state.ary
  }
}

export default connect(reciver)(App);
